import Header from '../../tools/header.js'
import Footer from '../../tools/footer.js'
import styles from ''

const Game = ({images}) => {
    return (
        <canvas id='canvas' width={`${images['gomokuBoard'].width * 19}`} height={`${images['gomokuBoard'].height * 19}`} style={{border:'5px solid black'}}>

        </canvas>
    )
}

const Humanvsia = ({images}) => {
    return (
        <div>
            <Header/>
            <Game images={images}/>
            <Footer/>
        </div>
    )
}

export default Humanvsia
